angular.module('testUtils', [])
	.factory('testUtils', function (fb, $timeout, seedDataURI){

		var testUtils = {};

		testUtils.flushAll = function(){
			fb.ref.flush();
	    try { 
	    	$timeout.flush() 
	    }
	    // Catch all digest errors! Throw all others!
	    catch (e) {
	    	if(!/digest/ig.test(e.message) && !/deferred/ig.test(e.message)){
	    		throw e
	    	}
	    }
		}

		testUtils.seedDataURI = seedDataURI;

		return testUtils
	})
	.value('seedDataURI', 
		"data:image/jpeg;base64,"
	)